import React from 'react';
// import CaseImages from '.../CaseImages';

export default function CaseStudyCard(props) {
    return (
        <div className="px-10 flex flex-col items-center min-w-max min-h-max">
            <img className="rounded-sm pb-2 w-64" src={props.image} alt={props.alt}/>
            <div className="flex justify-between w-64">
                <h3 className="text-white font-bold">{props.header}</h3>
                <p className="text-white text-base font-bold border border-solid border-white rounded-md py-1 px-2 text-center">
                    Case Name
                </p>
            </div>
        </div>
        )
};
